// src/components/Home/Sponsorships.js
import React from 'react';
import './Sponsorships.css';
import sponsorImage from '../../assets/Sponsor_Template.png';
import sponsorshipPdf from '../../assets/ECWSponsorship.pdf';

function Sponsorships() {
  return (
    <div className="sponsorships">
      <h1>Proudly Sponsored By:</h1>
      <img src={sponsorImage} alt="Sponsor Logo" className="sponsor-image" />
      <a href={sponsorshipPdf} target="_blank" rel="noopener noreferrer" className="sponsor-button">
        Sponsor Us
      </a>
    </div>
  );
}

export default Sponsorships;
